import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {LoginPage} from '../components/login/LoginPage'

export default function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/login" component={ LoginPage } />
        </Switch>
      </div>
    </Router>
  );
}
